import React from 'react';
import {Route, Switch, Redirect} from "react-router-dom"
import './CSS/styles.css';
import Navbar from "./Components/Navbar"
import Home from "./Components/Home"


function App(){ 
  return ( 
    <>
      <Navbar />
      <Switch>
        <Home />
        <Route /> 
      </Switch>
    </>

  )
}

export default App;
